import React, { useEffect, useState } from 'react';
import CardSmall from '../CardSmall';
import EditDogModal from './EditDogModal';

interface DogType {
	_id: string;
	name: string;
	breed?: string;
	age?: number;
	gender?: string;
	place?: string;
	video?: any;
	thumbnail?: any;
	canEdit?: boolean;
	images?: any[];
	adoptionStatus?: string;
	adoptionQueue?: any[];
	vaccinated?: boolean;
}

const DogList: React.FC = () => {
	const [dogs, setDogs] = useState<DogType[]>([]);
	const [editDog, setEditDog] = useState<DogType | null>(null);
	const [viewDog, setViewDog] = useState<DogType | null>(null);

	useEffect(() => {
		fetch('http://localhost:3001/api/dogs')
			.then(res => res.json())
			.then(data => setDogs(data))
			.catch(() => setDogs([]));
	}, []);

	const handleEdit = (dog: DogType) => setEditDog(dog);
	const handleViewDetails = (dog: DogType) => setViewDog(dog);
	const handleCloseModal = () => setEditDog(null);
	const handleCloseViewModal = () => setViewDog(null);
	const handleDogUpdate = (updatedDog: DogType) => {
		setDogs(dogs => dogs.map(d => d._id === updatedDog._id ? updatedDog : d));
		setEditDog(null);
	};
	const handleRemove = (dogId: string) => {
		setDogs(dogs => dogs.filter(d => d._id !== dogId));
	};

	return (
		<div style={{ padding: 24 }}>
			<div style={{ display: 'flex', flexWrap: 'wrap', gap: 24, justifyContent: 'center' }}>
				{dogs.map(dog => (
					<CardSmall
						key={dog._id}
						{...dog}
						canEdit={true}
						onEdit={() => handleEdit(dog)}
						onRemove={() => handleRemove(dog._id)}
						onDogUpdate={handleDogUpdate}
						onViewDetails={() => handleViewDetails(dog)}
					/>
				))}
			</div>
			{editDog && (
				<EditDogModal
					dog={editDog}
					isSingleDog={true}
					onSave={(updatedDog) => {
						handleDogUpdate(updatedDog);
						handleCloseModal();
					}}
					onClose={handleCloseModal}
				/>
			)}
			{viewDog && (
				<div className="viewdog-modal-container" style={{position:'fixed',top:'50%',left:'50%',transform:'translate(-50%, -50%)',background:'#fff',border:'3px solid #3498db',borderRadius:16,zIndex:999999,minWidth:320,maxWidth:640,padding:24}}>
					<button type="button" onClick={handleCloseViewModal} style={{position:'absolute',top:12,right:12,width:36,height:36,background:'#e74c3c',color:'#fff',border:'none',borderRadius:'50%',fontSize:'1.5rem',fontWeight:'bold',cursor:'pointer',zIndex:1000000}} aria-label="Close" title="Close">Ã—</button>
					<h2 style={{marginBottom:16}}>{viewDog.name}</h2>
					<div style={{marginBottom:8}}><strong>Breed:</strong> {viewDog.breed}</div>
					<div style={{marginBottom:8}}><strong>Age:</strong> {viewDog.age}</div>
					<div style={{marginBottom:8}}><strong>Gender:</strong> {viewDog.gender}</div>
					<div style={{marginBottom:8}}><strong>Place:</strong> {viewDog.place}</div>
					<div style={{marginBottom:8}}><strong>Status:</strong> {viewDog.adoptionStatus}</div>
					<div style={{marginBottom:8}}><strong>Adoption Queue:</strong> {viewDog.adoptionQueue && viewDog.adoptionQueue.length ? viewDog.adoptionQueue.join(', ') : 'None'}</div>
					<div style={{marginBottom:8}}><strong>Vaccinated:</strong> {viewDog.vaccinated ? 'Yes' : 'No'}</div>
					<div style={{marginBottom:8}}><strong>Video:</strong> {viewDog.video && viewDog.video.url ? viewDog.video.url : 'None'}</div>
					<div style={{marginBottom:8}}><strong>Thumbnail:</strong> {viewDog.thumbnail && viewDog.thumbnail.url ? viewDog.thumbnail.url : 'None'}</div>
					<div style={{marginBottom:8}}><strong>Images:</strong> {viewDog.images && viewDog.images.length ? viewDog.images.map((img:any,i:number)=>(<span key={i}>{img.url}{i < viewDog.images.length-1 ? ', ' : ''}</span>)) : 'None'}</div>
					{/* Add any other fields present in DogType here */}
				</div>
			)}
		</div>
	);
};

export default DogList;
